import React from 'react';
import Screen from './components/Screen/Screen'
import Button from './components/Button/Button'
import './App.css';

function App() {
  return (
    <main className='container'>
      <Screen />
      <div className='button-box'>
        <Button text={'7'}/>
        <Button text={'8'}/>
        <Button text={'9'}/>
        <Button text={'÷'}/>
        <Button text={'⇐'}/>
      </div>
      <div className='button-box'>
        <Button text={'4'}/>
        <Button text={'5'}/>
        <Button text={'6'}/>
        <Button text={'×'}/>
        <Button text={'y²'}/>
      </div>
    </main>
  );
}

export default App;
